import React from 'react'
import "../MainMenu/MainMenu.css"
import menu from "../../Data/MenuData"
import vegicon from "../../Images/veg-icon.png"
import nonVegicon from "../../../Images/"

function MainMenu() {
  return (
    <div>
      <h1>Recommended</h1>
      <p>5 items</p>
      <div>
        {
          menu.map((item)=>{
            return(
              <div className={` ${item.isVeg===true? vegicon : nonVegicon}`}></div>
            )
          })
        }
      </div>
    </div>
  )
}

export default MainMenu
